import Button from './Button';

function WrapperBtn(){
    const [count, setCount] = useState(0);

    return (
        <div className="button_wrapper">
            <p>{count}</p>
            <Button label="Ajouter {count}" styleclass="green" />
            <Button label="Enlever" styleclass="red" />
        </div>
    );
}




export default WrapperBtn;
